105.body:
The HEX function takes a BLOB (or coerces its argument into a UTF-8 string, which in turn is interpreted as a BLOB) and turns the BLOB into an upper-case hexadecimal string. The UNHEX function takes a hexadecimal string and turns it into a BLOB. The hexadecimal string provided must contain character pairs . UNHEX takes an optional second parameter: a string containing non-hexadecimal characters to be ignored in the first parameter. If non-hexadecimal characters are found in the first parameter but not ignored in the second parameter, UNHEX returns NULL. SELECT HEX(15);
-- '3135'
SELECT UNHEX('3135');
-- b'15'
SELECT UNHEX('3135ZZ', 'Z');
-- b'15'
SELECT UNHEX('3135ZZ', 'M');
-- NULL

115.body:
The TYPEOF function returns the type of the provided value. SELECT TYPEOF('hi2u');
SELECT TYPEOF(1.12345678901234);
SELECT TYPEOF(2018-01-01T00:00:00);

118.body:
The ARRAY_AGG function concatenates the results of an expression into an array. The parameter may be ordered within ARRAY_AGG. SELECT ARRAY_AGG(price) FROM products;
SELECT ARRAY_AGG(name ORDER BY price DESC) FROM products; Note that when operating on arrays, the arrays themselves will be concatenated, not the contents of the arrays. The result will be an array of one higher dimension: SELECT ARRAY_AGG(x.column1) FROM (VALUES ([1,2]), ([3,4])) AS x;
-- [{'column1': [[1, 2], [3, 4]]}]

135.body:
Navigating the root of any document (row) as a tree looks like standard SQL, because it is: SELECT a FROM paths; Similarly, however, it is possible to navigate documents listed in an array: SELECT [{a: 2}, {a: 3}, {b: 4}].a;
-- [{'a': [2, 3]}] It is also possible to navigate fields of sub-documents (columns of nested rows) with further dot notation: SELECT b.a FROM paths;
-- [{'a': 3}]

138.body:
The square bracket notation (['<NAME>']) performs a lookup of a single descendent child. SELECT { paths.* }['b']['a'] FROM paths;
-- [{'a': 3}] Named Children can be combined with recursive paths, though the default recursive path syntax is synonymous with named children: SELECT { paths.* }..a FROM paths;
SELECT { paths.* }..['a'] FROM paths; Both of the above expressions return [{'a': [2, 3, 1]}].

139.body:
The square bracket notation ([<NUMBER>]) can also perform indexed lookups of a single descendent child. SELECT { paths.* }['b'][0] FROM paths;
-- [{'column1': {'a': 3}}]
SELECT { paths.* }['c'][1] FROM paths;
-- [{'column1': 2}] Numbered Children can be combined with recursive paths. This finds and returns all indexed values, counting backward: SELECT { paths.* }..[-1] FROM paths;
-- [{'column1': [2]}]

143.body:
Takes an object, a path, and a new value. The new value is ignored if the path does not match an existing field. SELECT path_replace({a: 2, c: 4}, $.a, 99);
-- {'a': 99, 'c': 4}
SELECT path_replace({a: 2, c: 4}, $.e, 99);
-- {'a': 2, 'c': 4}

145.body:
Takes an object and a variable number of arguments specifying which paths to remove. If a path is not found, nothing is removed for that argument. # represents the last element in a collection. SELECT path_remove([0,1,2,3,4], $[#-1], $[0]);
-- [1, 2, 3]
SELECT path_remove({x: 25, y: 42}, $.y);
-- {'x': 25}

146.body:
Takes an object and a variable number of path arguments. Returns the value found at each path, if any, otherwise NULL. If only a single path is provided, a scalar is returned. If multiple paths are provided, an array is returned. SELECT path_extract({a: 2, c: [4, 5, {f: 7}]}, $.c[2].f);
-- 7
SELECT path_extract({a: 2, c: [4, 5], f: 7}, $.x, $.a);
-- [NULL, 2]

26.body:
Endb provides flexible upserts with the common ON CONFLICT clause. When the INSERT command detects a conflict, it will perform the instructions in the DO clause. The following command needs to be executed twice to see the upsert effect. INSERT INTO products {name: 'Pepper', price: 9.99} ON CONFLICT (name, price) DO UPDATE SET v = 2; To specify no operation on conflict, use DO NOTHING: INSERT INTO products {name: 'Pepper', price: 9.99} ON CONFLICT (name, price) DO NOTHING; To reference the document currently being inserted, the DO clause provides a statement-local relation named excluded. INSERT INTO products {name: 'Salt', price: 6};
INSERT INTO products {name: 'Salt', price: 7} ON CONFLICT (name) DO UPDATE SET price = excluded.price; Similarly, the existing table is still available in the DO clause to provide further filtering: INSERT INTO products {product_no: 99, name: 'Cumin', price: 3.00, v: 5};
INSERT INTO products {product_no: 99, name: 'Cumin', price: 5.00, v: 6} ON CONFLICT (product_no, name) DO UPDATE SET price = excluded.price, v = excluded.v WHERE products.v < 6;

33.body:
The most common way of filtering columns is to compare them. Endb provides =, >, <, >=, <= operators. These work on all column types, though comparing two disparate types may produce unexpected results. SELECT * FROM products WHERE product_no = 99;
SELECT * FROM products WHERE price < 4;
SELECT * FROM products WHERE name >= 'Cabin';

47.body:
"Union Compatibility" refers to the ability of two queries to be used in a union, intersection, or difference. Because Endb is dynamically-typed, the only constraint on union compatibility is the number of columns returned. In general, it only makes sense to use set operations on two queries which return either: (1) explicit columns, so order and naming are respected or (2) columns with the same names, so they are guaranteed to return in order, in the case of * queries. When applying set operations to * queries, keep in mind that the widest column set (across the entire history of the table) will be returned. If the queries return a different number of columns, set operations will result in an error: -> select * from products UNION select * from new_products;
400 Bad Request
Number of UNION left columns: 3 does not match right columns: 2

48.body:
The WITH keyword is used to create Common Table Expressions , or CTEs. CTEs act like temporary tables or views within the context of a query. CTEs are used in place of a sub-select to simplify the appearance of a query. WITH clauses take the form WITH <cte-name> AS (<cte-select>). WITH top_margin_products AS (SELECT product_no FROM products WHERE (price - cost) > 5.00)
SELECT name FROM products
WHERE product_no IN (SELECT product_no FROM top_margin_products);

49.body:
The RECURSIVE keyword can be added to WITH to create recursive CTEs which can refer to themselves. Recursive CTEs will always have the form <initial-select> UNION <recursive-select> or <initial-select> UNION ALL <recursive-select>. Here is a naive example, demonstrating the recursive construction of a Fibonacci Sequence: WITH RECURSIVE fib(previous, current) AS ( VALUES (0, 1) UNION ALL SELECT fib.current, fib.previous + fib.current FROM fib WHERE fib.previous + fib.current < 5000
)
SELECT * FROM fib; The most beneficial uses for WITH RECURSIVE are walking hierarchical and graph-shaped data sets -- capabilities ordinary SQL lacks. However, Endb recursive queries are also capable of solving Sudoku puzzles and constructing fractals, as seen in the test suite . (Credit goes to SQLite's delightful Outlandish Recursive Query Examples .)

63.body:
Objects (which can also be thought of as documents, or rows) can be created with object literals enclosed in curly braces, similar to JSON. Keys in object literals can be quoted or unquoted. {name: "Hanna", birthday: 1982-12-31} {'name': "Hanna", 'birthday': 1982-12-31} Alternatively, objects can be created using either an OBJECT constructor keyword, similar to that in the SQL Specification. OBJECT(name: 'Hanna', birthday: 1982-12-31) Object literals can contain spreads , computed fields , shorthands , and row literals . SELECT { a: 1, ...[2, 3] };
-- [{'column1': {'0': 2, '1': 3, 'a': 1}}]
SELECT { foo: 2, ['foo' || 2]: 5 };
-- [{'column1': {'foo': 2, 'foo2': 5}}]
SELECT {p.name, c.discounted} FROM products p JOIN coupons c ON p.name = c.name;
-- [{'column1': {'discounted': 2.99, 'name': 'Salt'}}]
SELECT {product: {p.*}, discounted: c.discounted} FROM products p JOIN coupons c ON p.name = c.name;
-- [{'column1': {'discounted': 2.99, 'product': {'name': 'Salt', 'price': 5.99}}}]

66.body:
The Spread Operator (..., sometimes known as "splat") can be used to directly flatten/unnest one collection (an array, object, or row literal) into another. Strings are treated as character collections. SELECT [1, 2, ...[3, 4], 5];
-- [{'column1': [1, 2, 3, 4, 5]}] SELECT [1, 2, ..."foo", 5];
-- [{'column1': [1, 2, 'f', 'o', 'o', 5]}] If an array is spread into an object, its ordinals will be used as properties: SELECT { a: 1, ...[2, 3] };
-- [{'column1': {'0': 2, '1': 3, 'a': 1}}]

67.body:
In the key/property position, square brackets are used to construct computed fields in object literals . SELECT { foo: 2, [2 + 2]: 5 };
-- [{'column1': {'4': 5, 'foo': 2}}]
SELECT { foo: 2, ['foo' || 2]: 5 };
-- [{'column1': {'foo': 2, 'foo2': 5}}]

70.body:
Two values can be compared using standard SQL comparison operators: =, == (equals) > (greater than) < (less than) >= (greater than or equal to) <= (less than or equal to) <>, != (not equal to) SELECT * FROM products WHERE NOT name = 'Coffee';
SELECT * FROM products WHERE name = 'Coffee' AND name <> 'Kaapi';
SELECT * FROM products WHERE name > 'Cake' AND price >= 5.00;

73.body:
Standard SQL mathemetical operators are available to any two numeric values: + (addition) - (subtraction) * (multiplication) / (division) % (modulo; integer remainder of division) << (left bit shift) >> (right bit shift) +NUMBER (unary plus) -NUMBER (unary minus) SELECT 1 + 3.555;
SELECT 1 - 3.555;
SELECT 2 * 3.555;
SELECT 2 / 3.555;
SELECT 2 % 3.555;
SELECT 62 << 2;
SELECT 62 >> 2;
SELECT +128.5;
SELECT -128.5; NOTE: Mathematical functions are documented under Functions .

74.body:
Standard SQL bitwise manipulation operators are available to any two values. & (bitwise and) | (bitwise or) The bitwise not operator is also available to a single value: ~ (bitwise not) SELECT 1 & 2;
SELECT 1 | 2;
SELECT ~1;

75.body:
LIKE returns true if a string matches the supplied LIKE pattern, as defined below: A pattern can be a string literal. It can also contain underscores (_) and/or percentage symbols (%). An underscore matches exactly one character. A percentage symbol matches zero or more characters. Backslash escapes the following character to make it a literal. Use ESCAPE to override the default backslash escape character. SELECT * FROM products WHERE name LIKE 'Tofu';
SELECT * FROM products WHERE name LIKE 'Tof_';
SELECT * FROM products WHERE name LIKE '%of%';
SELECT * FROM products WHERE name LIKE '\%of\%';
SELECT * FROM products WHERE name LIKE 'X%ofX%' ESCAPE 'X'; NOT LIKE is used to invert the results of the match. SELECT * FROM products WHERE name NOT LIKE '%of%'; NOTE: Endb LIKE is case-sensitive.

78.body:
MATCH returns true if the value on the left contains the value on the right, at the top level. Note that a top-level array to the right of the MATCH refers to a set of values that all need to match, not a literal array. The following expressions return true: SELECT 'foo' MATCH 'foo';
SELECT [1, 2, 3] MATCH [3, 1];
SELECT {user: 'foo', age: 42} MATCH {age: 42};
SELECT {a: [1, 2, {c: 3, x: 4}], c: 'b'} MATCH {a: [{x: 4}, 1]}; The following expressions return false: SELECT [1, 2, [1, 3]] MATCH [1, 3];
SELECT {foo: {bar: 'baz'}} MATCH {bar: 'baz'};
SELECT {a: [1, 2, {c: 3, x: 4}], c: 'b'} MATCH {a: [{x: 4}, 3]}; NOTE: The @> operator is a synonym for MATCH. It is provided as a convenience for users accustomed to the equivalent JSON Containment Operator in Postgres .

94.body:
The CHARACTER_LENGTH function returns the number of unicode characters in a string. SELECT CHARACTER_LENGTH('josé');
-- 4
SELECT CHARACTER_LENGTH('❤️🥫');
-- 3

95.body:
The OCTET_LENGTH function returns the length of a string, in bytes (octets). SELECT OCTET_LENGTH('josé');
-- 5
SELECT OCTET_LENGTH('❤️🥫');
-- 10

96.body:
The LENGTH function counts the number of entries in a collection. When supplied with a string, it is a synonym for CHARACTER_LENGTH. SELECT LENGTH([3, 2]);
SELECT LENGTH({name: 'Peas', price: 8.99, product_no: 77});
SELECT LENGTH('josé');

97.body:
The TRIM, LTRIM, and RTRIM functions trim surrounding whitespace, whitespace to the left, and whitespace to the right of a string, respectively. SELECT TRIM(' hello ');
-- 'hello'
SELECT LTRIM(' hello ');
-- 'hello '
SELECT RTRIM(' hello ');
-- ' hello'

98.body:
The LOWER and UPPER functions downcase and upcase a string, respectively. SELECT LOWER('Relatable Algebra');
-- 'relatable algebra'
SELECT UPPER('Shouting Calculus');
-- 'SHOUTING CALCULUS'
